import React, { useState } from 'react'

const Logos = () => {


  const list_images = {
    0: "https://upload.wikimedia.org/wikipedia/commons/thumb/0/0a/Python.svg/2048px-Python.svg.png",
    1: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/2300px-React-icon.svg.png",
    2: "https://upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Javascript_badge.svg/1200px-Javascript_badge.svg.png"
  }
  
  return (
    <div className='studied_images'>
        <img className='first image' src={list_images[count]}></img>
        <img className='second image' src={list_images[count+1]}></img>
        <img className='third image' src={list_images[count+2]}></img>
    </div>
  )
}

export default Logos
